import React from "react";
import { DropdownButton, Dropdown } from "react-bootstrap";

export default function LeftNav(props) {
  const friendArray = [
    {
      _id: "5f102efe265f31c8b4e48a12",
      name: "Bobby",
      pic: "/profilePic.png"
    },
    {
      _id: "5f102efe265f31c8b4e48a12",
      name: "Derek",
      pic: "/profilePic.png"

    },
    {
      _id: "5f102efe265f31c8b4e48a12",
      name: "Cindy",
    },
    {
      _id: "5f102efe265f31c8b4e48a12",
      name: "Janet",
    },
  ];

  return (
    <div className="leftNav">
      <DropdownButton id="dropdown-item-button">
        <div className="dropdownMenu">
          <Dropdown.Item as="button" onClick={() => props.eventShow(true)}>
            All Events
          </Dropdown.Item>
          <Dropdown.Item as="button">Your Events</Dropdown.Item>
          <Dropdown.Item disabled><b>Friend's List</b></Dropdown.Item>
          <Dropdown.Divider />
            {friendArray.map((id) => (
          <Dropdown.Item href="/login">
              <div key={id._id}>
                <span href="https://google.com"><img id="navImg" src="/profilePic.png"></img>{id.name}</span>
              </div>
          </Dropdown.Item>
            ))}
        </div>
      </DropdownButton>
    </div>
  );
}
